import React from "react";
import "./styles/App.css";
import ProjectList from "./components/ProjectList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Braden's Lambda Portfolio</h2>
        <ProjectList />
      </header>
    </div>
  );
}

export default App;
